const Marquee = props => (
  <div className="marquee">
    <img
      className="guc"
      alt="logo for dumpTRUCK dump.fm gallery showcase"
      src="/dumpTRUCKlogo.svg"
    />
    <hr />
    <div className="description">{props.children}</div>
    <style jsx>{`
      .description {
        font-family: "America Expanded Regular";
      }
      .guc {
        width: 175px;
        margin-bottom: 12px;
        margin-top: 3px;
      }
      .profile {
        background: green;
      }
      .marquee {
        background: #f8f8f8;
        padding-left: 20px;
        padding-top: 20px;
        padding-right: 20px;
      }
      .title {
        margin-top: 20px;
        margin-left: 5px;
        margin-right: 15px;
        padding-bottom: 50px;
        width: 85%;
        font-family: "America Expanded Regular";
        font-size: 3em;
      }
      hr {
        margin: 0px 5px;
      }
      .topFilesContainer {
        margin-left: 3px;
        padding-top: 20px;
      }
      .app {
        // margin: 10px;
        // margin-top: 20px;
        // padding-bottom: 100px;
      }
      @font-face {
        font-family: "America Expanded Regular";
        src: url("/fonts/GT-America-Expanded-Regular.otf") format("opentype");
        font-display: auto;
      }
    `}</style>
  </div>
);

export default Marquee;
